import Link from 'next/link';

const Navigation = () => {
    return (
        <ul>
            <li><Link href="/"><a>Index</a></Link></li>
            <li><Link href="/"><a>About</a></Link></li>
            <li><Link href="/"><a>Services</a></Link></li>
        </ul>
    )
}

export default Navigation;
